function LandingFrame() {
   const style = {
      "background-image": `url("images/background.jpg")`,
      "background-repeat": "no-repeat",
      "background-size": "cover",
      position: "absolute",
      height: "100%",
      width: "100%"
   }

   return <div style={style}></div>
}

function HomePage() {
   return <div>
      <LandingFrame />
   </div>
}

export default HomePage

function LandingFrameMessage() {
   const style = {
      margin: "auto",
      padding: "10% 35% 10% 15%",
      color
   }
}
